const pageTwoModule = {
  state: () => ({
      users: [],
      teste: 'teste em modules 2'
  }),
  mutations: {
    mudarEstadoTwo (state) {
      state.teste = state.teste + " Adicionando uma frase em componete 2"
    }
  },
  actions: {
    async function () {
      let data = await teste.userDetail()
      console.log(data.data.title)
    }
  }
}

export default pageTwoModule
